function reAsk(message, extra) {
    if (extra == null) {
        extra = "";
    }
    if (reactionArray.length != roleLimit) {
        var finalText = "";
        reactionArray.forEach(subarray => {
            finalText = finalText + `${subarray[0]} > ${subarray[2]}\n`
        })
        askQuestion(`Podaj połączenia **rola-emoji**, aby dodać auto-role  (Max ${roleLimit})\n ${finalText}\n\nJeżeli chcesz dodać inną reakcje do roli, podaj role na nowo z nową reakcją.\nnp. PrzykładowaRola 😃\nJeżeli nie, napisz "**gotowe**".\nJeżeli chcesz zakończyć tworzenie auto-roli wpisz "anuluj"\n\n${extra}`).then(async (response) => {
            if (response.content.toLowerCase() == "gotowe") {
                if (reactionArray.length > 0) {
                    done(message);
                } else {
                    errorCheck(message, `**Dodaj przynajmniej jedną emoji do jednej roli!\nPozostałe próby - ${errorCatch}**`, "Tworzenie auto-roli anulowane, dodałes tą samą emoji do dwóch auto-roli!\nPonów próbę komendą .rolemenu!");
                }
            } else if (response.content.toLowerCase() == "anuluj") {
                errorMessage("Tworzenie auto-roli anulowane.\nPonów próbę komendą .rolemenu!", "Użytkownik anulował tworzenie auto-roli", message);
            } else {
                var regString = response.content;
                var execReg = /[^\x00-\x7F]/g.exec(regString) || /\<:(.*?)\>/g.exec(regString) || /\<a:(.*?)\>/g.exec(regString);
                var msgSplitArr = null;

                if (execReg != null) {
                    msgSplitArr = [regString.substring(0, execReg["index"]), regString.substring(execReg["index"])];
                }

                if (msgSplitArr != null && msgSplitArr.length > 1 && msgSplitArr[0] != null && msgSplitArr[1] != null) {
                    const tstValidRole = await msg.guild.roles.find(role => role.name === msgSplitArr[0].replace(/\s+$/, ''));

                    if (response.mentions.roles.first() || tstValidRole != null) {
                        var unicodeStored = msgSplitArr[1];
                        if (response.mentions.roles.first() != null) {
                            roleMentioned = response.mentions.roles.first();
                        } else {
                            roleMentioned = tstValidRole;
                        }
                        if (!roleArray.includes(roleMentioned.id) && !emojiArray.includes(unicodeStored)) {
                            if (unicodeStored.includes("<:") || unicodeStored.includes("<a:")) {
                                var emoji;

                                unicodeStored = unicodeStored.replace(/\D/g, '');
                                emoji = localEmoji.filter(emojiT => emojiT.id == unicodeStored);
                                if (emoji.length > 0) {
                                    unicodeStored = emoji[0];
                                    delete unicodeStored['guild']
                                    reactionArray.push([unicodeStored, roleMentioned.id, roleMentioned.name]);
                                    emojiArray.push(unicodeStored);
                                    roleArray.push(roleMentioned.id);
                                    reAsk(message);
                                } else {
                                    errorCheck(message, `**Dodaj właściwe emoji!\n${localEmojiG}\nPozostałe próby - ${errorCatch}**`, `Tworzenie auto-roli anulowane, podałeś niewłaściwe emoji!\n${localEmojiG}\nUżyj komendy .rolemenu aby ponowić próbę!`)
                                }
                            } else {
                                reactionArray.push([unicodeStored, roleMentioned.id, roleMentioned.name]);
                                emojiArray.push(unicodeStored);
                                roleArray.push(roleMentioned.id);
                                reAsk(message);
                            }
                        } else {
                            errorCheck(message, `**Nie używaj tego samego emoji drugi raz!\nPozostałe próby - ${errorCatch}**`, "Tworzenie auto-roli anulowane, użyto dwa razy tą samą emoji!\nUżyj komendy .rolemenu aby ponowić próbę!");
                        }
                    } else {
                        errorCheck(message, `**Podaj poprawną nazwę roli!\nPozstałe próby - ${errorCatch}**`, "Tworzenie auto-roli anulowane, podano niewłaściwe role!\nUżyj komendy .rolemenu aby ponowić próbę!");
                    }
                } else {
                    errorCheck(message, `**Podaj właściwą rolę i emoji!\nPozostałe próby - ${errorCatch}**`, "Tworzenie auto-roli anulowane, nie podano roli z emoji!\nUżyj komendy .rolemenu aby ponowić próbę!");
                }
            }
        });
    } else {
        done(message);
    }
}


function done(message) {
    var finalText = "";
    reactionArray.forEach(subarray => {
        finalText = finalText + `${subarray[0]} > ${subarray[2]}\n`
    })

    askQuestion(`Finał tworenia auto-roli\n\nPoniżej znajduje się lista roli z ich reakcjami\n${finalText}\n\nJeżeli wszystko się zgadza **oznacz** **kanał tekstowy**, gdzie auto-role zostaną wysłane.\nJeżeli auto-role się nie zgadzają odpowiedz "**anuluj**".`).then ((response) => {
        if (response.mentions.channels.first()) {
            var menchannel = response.mentions.channels.first()
            message.delete();
            menchannel.send({
                    embed: {
                        color: 0xffff00,
                        title: embedSettings[0],
                        description: `${embedSettings[1]}\n\n${finalText}`,
                        timestamp: new Date()
                    }
                })
                .then(embedmessage => {
                    interval = setInterval(function() {
                        emojiTimerInt(embedmessage, reactionArray);
                    }, 500)
                    rectarray[embedmessage.id] = reactionArray
                    _this.storeValue(rectarray, 3, "reactionRoleInf", cache);
                    fs.writeFile("./data/reactionRoleData.json", JSON.stringify(rectarray), function(err) {
                        if (err) {
                            return console.log(err);
                        }
                    });
                });
        } else {
            errorMessage("Nie podałeś prawdziwego kanału!\nUżyj komendy .rolemenu aby ponowić próbę!", "Użytkownik nie podał prawdziwego kanału.", message);
        }
    });
}

function emojiTimerInt(message, subarray) {
    message.react(subarray[emojiTimerRe][0])
    emojiTimerRe += 1;

    if (emojiTimerRe == subarray.length) {
        clearInterval(interval);
    }
}

function errorMessage(error, errorCause = "none") {

    if (debug) {
        console.log(errorCause);
    }

    if (mainMessage != null) {
        mainMessage.delete();
    }

    let errorTemplate = new Discord.RichEmbed({
        color: 0xFF0000,
        author: {
            name: client.user.username,
            icon_url: client.user.avatarURL
        },
        title: "Menu tworzenia auto-roli",
        description: error,
        timestamp: new Date(),
    })

    msg.channel.send(errorTemplate);
}

function errorCheck(mainMessage, erMsgCatch, erMsgFail) {
    if (errorCatch > 0) {
        errorCatch -= 1;
        reAsk(mainMessage, erMsgCatch)
    } else {
        errorMessage(erMsgFail, "Użytkownik wykorzystał limit prób.", mainMessage);
    }
}


function askQuestion(question) {
    return new Promise(function(resolve, reject) {
        embedTemplate["description"] = question;
        mainMessage.edit(embedTemplate);
        msg.channel.awaitMessages(response => response.author.id == msg.author.id, {
                max: 1,
                time: 60000,
                errors: ['time'],
            })
            .then(function(collected) {
                msg.author.lastMessage.delete();
                resolve(collected.first());
            }).catch((error) => {
                errorMessage('Wybacz, nie odpowiedziałeś prawidłowo w określonym czasie!\nUżyj komendy .rolemenu aby ponowić próbę!!', error);
            });
    })

}

